contract lec5{
// 접근제한자 public, private, internal, external
    uint256 public a = 5;
    uint256 private pa = 6;


    function changeA(uint256 _value) external {
        a = _value;
    }
    function get_A() view external returns(uint256){
        return  a;
    }

}
